    <title>Animated Banner - Innova TIK</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
      }

      .wrapper {
        width: 100%;
      }

      #hs1,
      #hs2,
      #hs3,
      #hs4,
      #hs5 {
        transform-box: fill-box;
        transform-origin: center bottom;
        animation: float 3s ease-in-out infinite alternate;
      }

      #hs2 {
        animation-delay: 0.15s;
      }

      #hs3 {
        animation-delay: 0.3s;
      }
      #hs4 {
        animation-delay: 0.45s;
      }
      #hs5 {
        animation-delay: 0.6s;
      }

      @keyframes float {
        0%,
        100% {
          transform: translate(0px, 0px);
        }

        50% {
          transform: translate(0px, -10px);
        }
      }

      #hs1-shadow,
      #hs2-shadow,
      #hs3-shadow,
      #hs4-shadow,
      #hs5-shadow {
        transform-box: fill-box;
        transform-origin: center bottom;
        animation: shadowInOut 3s ease-in-out infinite alternate;
      }

      #hs2-shadow {
        animation-delay: 0.15s;
      }

      #hs3-shadow {
        animation-delay: 0.3s;
      }
      #hs4-shadow {
        animation-delay: 0.45s;
      }
      #hs5-shadow {
        animation-delay: 0.6s;
      }

      @keyframes shadowInOut {
        0%,
        100% {
          transform: scaleX(1);
        }

        50% {
          transform: scaleX(0.6);
        }
      }

      #text-sec {
        animation: bannerHeaderIn 6s ease-out infinite;
      }

      @keyframes bannerHeaderIn {
        0% {
          opacity: 0;
          transform: translate(50px, 0px);
        }

        16% {
          transform: translate(0px, 0px);
          opacity: 1;
        }

        84% {
          transform: translate(0px, 0px);
          opacity: 1;
        }

        100% {
          opacity: 0;
          transform: translate(-50px, 0px);
        }
      }

      #btn {
        animation: btnIn 6s ease-out infinite;
      }

      @keyframes btnIn {
        0% {
          opacity: 0;
          transform: translate(-50px, 0px);
        }

        16% {
          transform: translate(0px, 0px);
          opacity: 1;
        }

        84% {
          transform: translate(0px, 0px);
          opacity: 1;
        }

        100% {
          opacity: 0;
          transform: translate(50px, 0px);
        }
      }
    </style>
